webpackJsonp([1899],{"./node_modules/json-loader/index.js!./.cache/json/articles-css-css-framework-skeleton.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h1>CSS Framework Skeleton</h1>\n<p>Skeleton is a dead simple boilerplate to kickstart any responsive project.</p>\n<h2>Getting Started</h2>\n<p>Here is a simple HTML template which includes the latest compiled and minified CSS for the Skeleton library.</p>\n<pre><code>&#x3C;!DOCTYPE html>\n&#x3C;html lang="en">\n  &#x3C;head>\n    &#x3C;meta charset="utf-8">\n    &#x3C;meta name="viewport" content="width=device-width, initial-scale=1">\n    &#x3C;title>Skeleton Template&#x3C;/title>\n    &#x3C;link href="//fonts.googleapis.com/css?family=Raleway:400,300,600" rel="stylesheet" type="text/css">\n    &#x3C;link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/normalize/4.1.1/normalize.min.css">\n    &#x3C;link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/skeleton/2.0.4/skeleton.min.css">\n  &#x3C;/head>\n  &#x3C;body>\n    &#x3C;h1>Hello World&#x3C;/h1>\n    &#x3C;!-- Add all HTML Code here -->\n    &#x3C;script src="https://ajax.googleapis.com/ajax/libs/jquery/1.11.3/jquery.min.js">&#x3C;/script>\n  &#x3C;/body>\n&#x3C;/html>\n</code></pre>\n<p> <kbd><a href="http://jsbin.com/sekojaxali/edit?html,output"><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/3/31bd555700f1ee85bb4ddcacf595f0dfd8a16254.png"> <strong>JSBin Demo</strong></a></kbd> </p>\n<p>We have used a CDN in this example, but you can checkout other ways of installing Skeleton <a href="https://github.com/dhg/Skeleton#getting-started">here</a>.</p>\n<h2>Learning Resources</h2>\n<ul>\n<li><img src="//forum.freecodecamp.com/images/emoji/emoji_one/point_right.png?v=2" alt=":point_right:" title=":point_right:"> <a href="http://getskeleton.com/#grid"><strong><code>Official Documentation</code></strong></a> of Skeleton.</li>\n<li>Checkout Skeleton\'s open source GitHub repository <a href="https://github.com/dhg/Skeleton">here</a>.</li>\n<li><a href="http://getskeleton.com/#examples">Here</a> are some examples of how Skeleton was used on different websites.</li>\n</ul>',frontmatter:{title:"CSS Framework Skeleton",parent:"/home/stuart/guides/src/pages/articles/css/css-framework-skeleton/index.md absPath of file"}}},pathContext:{slug:"/articles/css/css-framework-skeleton/"}}}});
